import { Link } from "react-router-dom";

const Products = () => {
  return (
    <section>
      <h1>The Products Page</h1>
      <ul>
        <l><Link to='/products/p1'>A Book</Link></l>
        <li><Link>A Carpet</Link></li>
        <li><Link>A Course</Link></li>
      </ul>
    </section>
  );
};

export default Products;
